import React from 'react';
import { CustomButtonContainer } from './CustomeButton.Styles';

import './CustomButton.Styles.scss';

const CustomButton = ({ children, ...otherProps }) => (
  <CustomButtonContainer

    {...otherProps}
  >
    {children}
  </CustomButtonContainer>
);

export default CustomButton;
